import { styled } from '@mui/styles';

const ContentWrapper = styled('div')({
    marginTop: '16px',
    padding: '24px',
    backgroundColor: '#fff',
    width: '100%',
    border: '1px solid #dee2e6 !important',
    borderRadius: '5px',
});

export default ContentWrapper;
